import React, { useEffect } from 'react';
import "./header.css"

function Header() {
    useEffect(() => {
        function ScrollShadow() {
            window.onload = () => {
                var config = {
                    right: '0px',
                    bottom: '0px',
                    width: 350,
                    height: 350,
                    basePath: '/static/live2d/Resources',
                    role: 'Domino',
                    opacity: 1,
                    mobile: false
                };
                var v = new Viewer(config);
            }

            sendColorSchemePreference();
            $(document).ready(function() {
                headerShadow();
            });
        }

        ScrollShadow();
    }, []);

    return (
        <div className="header">
            <link rel="stylesheet" herf="style.css" />
            <link rel="stylesheet" href="/static/css/live2d.css" />

            {/* Live2DCubismCore */}
            <script src="https://cubism.live2d.com/sdk-web/cubismcore/live2dcubismcore.min.js"></script>

            {/* Include Pixi */}
            <script src="/static/live2d/frame/pixi.min.js"></script>

            {/* Include Cubism Components */}
            <script src='/static/live2d/live2dcubismframework.js'></script>
            <script src='/static/live2d/live2dcubismpixi.js'></script>

            {/* User's Script */}
            <script src="/static/live2d/l2d.js"></script>
            <script src='/static/live2d/main.js'></script>

            <header>
                <div class="container">
                    <div id="branding">
                        <h1><a id="header_logo" href="/"><span class="highlight">BinL</span>Tools</a></h1>
                    </div>
                    <nav>
                        <ul>
                            <li><a href="/about_me">About Me</a></li>
                            <li><a href="https://github.com/BinL233">GitHub</a></li>
                            {/* TODO: Need to link to backend */}
                            <li><a href="/login"></a></li>
                        </ul>
                    </nav>
                </div>
            </header>
            <body>
                <div class="l2d"  id="L2d" >
                    <div id="L2dCanvas" class="Canvas"></div>
                </div>
            </body>
        </div>
    )
}

export default Header;
